import React from 'react'
import Filho from './Filho'

export default props => {
    const notificarSaida =
        lugar => alert(`Liberado para ${lugar}`)
        return(
            <div>
                <Filho notificarSaida={notificaSaida} />
            </div>
        )
        
}
